import './App.css';
import Nav from './components/nav/navbar.component';
import Footer from './components/footer/footer.component';
import { Routes,Route } from 'react-router-dom';
import About from './components/pages/about/about.component';
import NotFound from './components/pages/notFound/notFound.component';
import { useEffect } from 'react';


function App() {

  useEffect(()=>{

    const data = async ()=>{
      const info = await fetch("https://api.github.com/users",{
        headers: {}
      })

      const res = await info.json()

      console.log(res);

    }

    data()
  },[])



  return (
    <div className="flex flex-col justify-between bg-slate-700 h-screen ">
      <Nav/>
      <Routes>
        <Route path={"/"} element={
          <>
            <h1 className="bg-red-400">Home</h1>
          </>
        }/>
        <Route path={"/about"} element={<About/>}/>
        <Route path={"/*"} element={<NotFound/>}/>
        <Route path={"/404"} element={<NotFound/>}/>
      </Routes>
      <Footer/>
    </div>
  );
}

export default App;
